import React, { useState } from 'react'

 const Sign = () => {
    const[data,setData]=useState('')
    const[input,setInput]=useState('')
    const[val,setValue]=useState('')

    const handle =(e)=>{
        setData(e.target.value)
    }
    const handlEmail =(e)=>{
        setInput(e.target.value)
    }
    const handlePass =(e)=>{
        setValue(e.target.value)
    }



    return (
        <div>
            <h1>Sign Up</h1>
            <form className=''>
                full Name : <input type="text" value={data} onChange={handle} placeholder='type name' />
                Email : <input type="text" value={input} onChange={handlEmail} placeholder='type name' />
                Password : <input type="text" value={val} onChange={handlePass} placeholder='type name' />

            </form>
        </div>
    )
}
export default Sign
